import React from 'react';
import { Grid, Menu, Segment} from 'semantic-ui-react';

export default ()=>{
    return(
        <Grid style={{marginTop: '10px'}}>
            <Grid.Column width={4}>
                <Menu fluid vertical tabular>
                    <Menu.Item name='Home' />
                </Menu>
            </Grid.Column>
        </Grid>
    );
}
